import React from 'react';
import './styles.css';

const topPart = {
    margin: "100px",
    height: "80vh",
}

const headline = {
    fontSize: "50px",
}

const subheader = {
    fontSize: "25px",
}

const description = {
    backgroundColor: "#0074D9",
    width: "100%",
    height: "600px",
    padding: "10px 50px 10px 50px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    color: "white",
}

export default function Frontpage() {
    return (
        <div className="Body">
            <div style={topPart}>
                <h1 style={headline}>Front-end developer, biologist</h1>
                <i style={subheader}>I design and code awesome stuff, and I love what I do!</i>
            </div>
            <div style={description}>
                <h1>Hey, I'm Nikolaj</h1>
                <p>A passionated developer that aims to make beautiful yet usefull products</p>
            </div>
        </div>

    )
}
